false" QFormat="true" Name="Book Title"/>\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\n </w:LatentStyles>\n</xml><![endif]--></u><style type="text/css"></style><u><!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:"Table Normal";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin:0cm;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:"Calibri","sans-serif";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:"Times New Roman";\n	mso-fareast-theme-font:minor-fareast;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->  </u> </meta>\n</meta>\n</meta>\n</meta>\n</p>\n<p class="MsoNormal"><span style="font-size: small;"><span style="font-family: Verdana;"><u><b style=""><span lang="IN">KASUS POSISI</span></b></u></span></span><b style=""><span lang="IN" style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></b></p>\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: small;"><span style="font-family: Verdana;"><span lang="IN">Terdakwa adalah Penyidik pada Komisi Pemberantasan Korupsi pada tahun 2005. Pada saat menjadi penyidik dalam perkara dugaan tindak pidana korupsi penjualan tanah PT Industri Sandang Nusantara terdakwa melalukan pemerasan terhadap seorang Saksi. Pemerasan dilakukan dengan cara mengancam Saksi akan dijadikan tersangka jika saksi tidak memberikan sejumlah uang. Perbuatan tersebut dilakukan secara berulang-ulang dalam kurun waktu antara bulan juni 2005 hingga februari 2006, dengan total kerugian yang dialami korban sebesar Rp. 413.000,- dan uang dalam bentuk US $ sebesar $300, serta 3 buah handphone. </span></span></span><span lang="IN" style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></p>\n<p class="MsoNormal"><span style="font-family: Verdana;"><span lang="IN" style="font-size: 11pt;"><o:p></o:p></span></span><span style="font-size: small;"><span style="font-family: Verdana;"><u><b style=""><span lang="IN">TUNTUTAN</span></b></u></span></span><b style=""><span lang="IN" style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></b></p>\n<p class="MsoNormal"><span style="font-size: small;"><span style="font-family: Verdana;"><span lang="IN">Dalam tuntutannya Jaksa Penuntut Umum menuntut terdakwa dengan pidana penjara selama 12 tahun dan denda sebesar Rp. 200.000, - subsidair kurungan selama 6 bulan. </span></span></span><span lang="IN" style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></p>\n<p class="MsoNormal"><span style="font-family: Verdana;"><span lang="IN" style="font-size: 11pt;"><o:p></o:p></span></span><span style="font-size: small;"><span style="font-family: Verdana;"><u><b style=""><span lang="IN">ALASAN KASASI</span></b></u></span></span><b style=""><span lang="IN" style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></b></p>\n<p><span style="font-size: small;"><span style="font-family: Verdana;"> <span lang="IN">Dalama memori kasasinya Pemohon/Terdakwa mendalilkan bahwa Judex Factie telah salah dalam menerapkan hukum khususnya dalam menerapkan unsur &ldquo;memaksa&rdquo; yang terdapat dalam pasal 12 huruf e UU 31/2002 jo. UU No. 20/2002.</span></span></span></p>\n<p>&nbsp;</p>'),
