an judex facti yang menyatakan bahwa perbuatan dilakukan atas inisiatif dan kehendak Ronald Nangoi, SE. (suami Terdakwa) tanpa sepengetahuan Terdakwa sehingga perbuatan tersebut secara materil tidak dapat dipertanggungjawabkan kepada Terdakwa merupakan pertimbangan yang keliru</span></span><span style="font-size: 11pt;"><o:p></o:p></span></li>\n    <li><span style="font-size: small;"><span style="font-family: Verdana;">Menimbang, bahwa berdasarkan alasan-alasan yang diuraikan di atas</span></span><span style="font-size: 11pt;"><o:p></o:p></span><span style="font-size: small;"><span style="font-family: Verdana;"> Mahkamah Agung berpendapat, Pemohon Kasasi/Jaksa Penuntut Umum telah dapat membuktikan bahwa perbuatan yang dilakukan oleh Terdakwa adalah perbuatan pidana sebagaimana yang didakwakan dalam dakwaan alternatif ke satu, oleh karena itu putusan Pengadilan Negeri Manado No.130/PID.B/2003/ PN.MDO. tanggal 27 Oktober 2003 yang melepaskan Terdakwa dari semua tuntutan hukum tidak dapat dipertahankan lagi.</span></span><span style="font-size: small;"><span style="font-family: Verdana;"><br />\n    </span></span></li>\n</ol>'),
