small;"><span style="font-family: Verdana;"><!--[if gte mso 10]>\n<style>\n/* Style Definitions */\ntable.MsoNormalTable\n{mso-style-name:"Table Normal";\nmso-tstyle-rowband-size:0;\nmso-tstyle-colband-size:0;\nmso-style-noshow:yes;\nmso-style-priority:99;\nmso-style-qformat:yes;\nmso-style-parent:"";\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\nmso-para-margin:0cm;\nmso-para-margin-bottom:.0001pt;\nmso-pagination:widow-orphan;\nfont-size:11.0pt;\nfont-family:"Calibri","sans-serif";\nmso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;\nmso-fareast-font-family:"Times New Roman";\nmso-fareast-theme-font:minor-fareast;\nmso-hansi-font-family:Calibri;\nmso-hansi-theme-font:minor-latin;\nmso-bidi-font-family:"Times New Roman";\nmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->Terdakwa RINNIE JULIET KAMBEY didakwa melakukan korupsi atas Program Kredit Usaha Tani (KUT). Program ini merupakan bentuk bantuan kredit kepada petani berasal dari Kredit Likuiditas Bank Indonesia. Terdakwa adalah sebagai pelaksana Program Kredit Usaha Tani (KUT) di Kecamatan Malalayang, Kota Manado. Untuk itu, terdakwa membentuk kelompok petani fiktif guna mendapatkan dana dari Program KUT. kelompok tani yang dibentuk oleh Terdakwa yang dinamakan Kelompok Tani Karya dengan jumlah anggota 34 orang. kelompok tani yang dibentuk Terdakwa mengajukan permohonan Kredit Usaha Tani (KUT) sebesar Rp.108.732.000. Uang sebesar Rp. 200.000 diberikan kepada orang yang namanya dicantumkan dalam kelompok petani fiktif tersebut. Akibat dari perbuatan Terdakwa yang dengan melawan hukum memperkaya pribadinya dengan dana Kredit Usaha Tani (KUT) sebesar Rp.108.532.000,-</span></span></p>\n<p><u><strong><span style="font-size: small;"><span style="font-family: Verdana;">TUNTUTAN</span></span></strong></u><span style="font-size: small;"><span style="font-family: Verdana;"><br />\n</span></span></p>\n<p>\n<meta content="text/html; charset=utf-8" http-equiv="Content-Type" />\n<meta content="Word.Document" n