ked="false" Priority="33" SemiHidden="false"\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\n </w:LatentStyles>\n</xml><![endif]--></span></span><style type="text/css"></style><span style="font-size: small;"><span style="font-family: Verdana;"><!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:"Table Normal";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-qformat:yes;\n	mso-style-parent:"";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin:0cm;\n	mso-para-margin-bottom:.0001pt;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:"Calibri","sans-serif";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:"Times New Roman";\n	mso-fareast-theme-font:minor-fareast;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:"Times New Roman";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]--> </span></span></meta>\n</meta>\n</meta>\n</meta>\n</p>\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: small;"><span style="font-family: Verdana;"><span lang="IN">bahwa meskipun pengertian paksaan secara psikis tidak diatur dalam Undang-Undang Hukum Pidana, namun ketentuan dalam KUH Perdata dapat dijadikan pedoman, yakni Pasal 1324 KUH Perdata yang berbunyi :</span></span></span><span lang="IN" style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></p>\n<p class="MsoNormal" style="margin-left: 36pt; text-align: justify;"><span style="font-size: small;"><span style="font-family: Verdana;"><span lang="IN">&ldquo;- Paksaan telah terjadi, apabila perbuatan itu sedemikian rupa hingga dapat menakutkan seorang yang berpikiran sehat, dan apabila perbuatan itu dapat menimbulkan ketakutan pada orang tersebut bahwa dirinya atau kekayaannya terancam dengan suatu kerugian yang terang dan nyata;</span></span></span><span lang="IN" style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></p>\n<p class="MsoNormal" style="margin-left: 36pt; text-align: justify;"><span style="font-size: small;"><span style="font-family: Verdana;"><span lang="IN">- Dalam mempertimbangkan hal itu, harus diperhatikan usia, kelamin dan kedudukan orang-orang yang bersangkutan &ldquo;;</span></span></span><span lang="IN" style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></p>\n<p class="MsoNormal" style="text-align: justify;"><span style="font-family: Verdana;"><span lang="IN" style="font-size: 11pt;"><o:p><span style="font-size: small;"><br />\n</span></o:p></span></span><span style="font-size: small;"><span lang="IN" style="font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span><span style="font-family: Verdana;"><span lang="IN">bahwa kata-kata &ldquo;hati-hati nanti jadi tersangka&rdquo; atau &ldquo;mau tidak berpisah dengan anak dan suami&rdquo;, apalagi kata-kata &ldquo;Bu harus berdoa untuk keselamatan karena perkembangan kasus buruk sekali&rdquo; yang disampaikan oleh seorang penyidik yang dalam penyidikannya juga melakukan pemeriksaan terhadap seorang saksi yang awam hukum, menurut akal yang sehat, kata-kata tersebut menimbulkan ketakutan pada orang tersebut (saksi Tintin Surtini) bahwa dirinya terancam akan dijadikan Tersangka bahkan akan dipisahkan dari anak dan suami yang tentunya karena ditahan ; </span></span></span><span lang="IN" style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></p>\n<p class="MsoNormal" style="text-align: justify;"><span style="font-family: Verdana;"><span lang="IN" style="font-size: 11pt;"><o:p></o:p></span></span><span style="font-size: small;"><span style="font-family: Verdana;"><span lang="IN">bahwa sebagai orang yang awam hukum, saksi Tintin Surtini tidak tahu prosedur yang berlaku di KPK, namun kata-kata dari penyidik itu sendiri sudah menjadikan ia ketakutan sehingga ia akan menuruti apa yang diminta oleh penyidik tersebut</span>.</span></span><span style="font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;"><o:p></o:p></span></p>\n<p>&nbsp;</p>'),
