le\n{mso-style-name:"Table Normal";\nmso-tstyle-rowband-size:0;\nmso-tstyle-colband-size:0;\nmso-style-noshow:yes;\nmso-style-priority:99;\nmso-style-qformat:yes;\nmso-style-parent:"";\nmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\nmso-para-margin:0cm;\nmso-para-margin-bottom:.0001pt;\nmso-pagination:widow-orphan;\nfont-size:11.0pt;\nfont-family:"Calibri","sans-serif";\nmso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;\nmso-fareast-font-family:"Times New Roman";\nmso-fareast-theme-font:minor-fareast;\nmso-hansi-font-family:Calibri;\nmso-hansi-theme-font:minor-latin;\nmso-bidi-font-family:"Times New Roman";\nmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->     </span></span></meta>\n</meta>\n</meta>\n</meta>\n</p>\n<p style="text-align: justify;" class="MsoNormal"><span style="font-size: small;"><span style="font-family: Verdana;">Terdakwa adalah Bendahara Umum dan Sekretaris Daerah Provinsi Sulawesi Utara, yang didakwa karena menggelapkan uang Kas Daerah Provinsi Sulawesi Utara sebesar Rp.72.227.129.985 serta Bunga Deposito On Call masing-masing sejumlah Rp.14.554.429,59 dan Rp.62.575.555,55. </span></span><o:p></o:p></p>\n<p style="text-align: justify;" class="MsoNormal"><span style="font-size: small;"><span style="font-family: Verdana;">Peristiwa ini bermula ketika ada kelebihan dana APBD Provinsi Sulut pada tahun 2001. Gubernur Sulut melalui Terdakwa II telah memerintahkan terdakwa I untuk mendepositokan sisa uang tersebut sesuai dengan Kepmendagri Nomor 32/1999 tentang Pelaksanaan Tugas Pemegang Kas Daerah dalam Pengurusan Keuangan Daerah dan Kepmendagri No. 32/1999 tentang Pelaksanaan Tugas Pemegang Kas Daerah dalam Pengurusan Keuangan Daerah. </span></span><o:p></o:p></p>\n<p style="text-align: justify;" class="MsoNormal"><span style="font-size: small;"><span style="font-family: Verdana;"><o:p></o:p></span>\n<p style="text-align: justify;" class="MsoNormal"><span style="font-family: Verdana;">Terdakwa I kemudian mendepositokan seluruh dana tersebut, kemudian setelah itu terdapat pencairan deposito sebesar Rp.29.000.000.000 dan masuk ke Kas Daerah Propinsi Sulut. Akan tetapi Terdakwa I tidak melakukan pembukuan atas sisa deposito yang ada beserta bunganya yang didapat. </span></p>\n</span>\n<p style="text-align: justify;" class="MsoNormal">&nbsp;</p>\n</p>\n<p style="text-align: justify;" class="MsoNormal"><o:p></o:p></p>\n<p style="text-align: justify;" class="MsoNormal"><span style="font-size: small;"><span style="font-family: Verdana;"><o:p> </o:p></span></span><span style="font-family: Verdana;"><o:p></o:p></span>\n<p style="text-align: justify;" class="MsoNormal"><span style="font-size: small;"><span style="font-family: Verdana;">Kemudian pada akhir masa jabatannya Terdakwa II selaku Sekretaris Daerah Propinsi Sulut pada tanggal 5 Januari 2002 tidak menyerahterimakan Deposito Pemerintah Propinsi Sulut kepada penggantinya, Terdakwa II juga tidak menarik kembali specimen tandatangan dan paraf dari Bank Sulut Manado dan Bank Mandiri Manado tempat pendepositoan dana milik Pemerintah Propinsi Sulut tersebut. Selanjutnya Terdakwa I selaku bendahara yang mengetahui bahwa Terdakwa II belum menarik specimen tandangan dan parafnya kemudian tidak melaporkan masalah ini kepada Sekda yang baru. Peristiwa ini diketahui oleh anggota DPRD Provinsi Sulawesi Utara yang kemudian melaporkannya ke Polda Sulut.</span></span></p>\n</p>\n<p style="text-align: justify;" class="MsoNormal">&nbsp;</p>\n<p style="text-align: justify;" class="MsoNormal"><span style="font-size: small;"><span style="font-family: Verdana;">&nbsp;</span></span></p>\n<p style="text-align: justify;" class="MsoNormal">&nbsp;</p>\n<p><span style="font-size: small;"><span style="font-family: Verdana;">\n<p style="text-align: justify;" class="MsoNormal"><strong><u>TUNTUTAN<br />\n</u></strong></p>\n</span></span></p>\n<p style="text-align: justify;" class="MsoNormal">\n<meta content="text/html; charset=utf-8" http-equiv="Content-Type">\n<meta content="Word.